import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/SetupPipeline.css';
import data from './data';


function Toolbar()
{
    return(
        <div>
            <div id="toolbar" class="our-services section">
                <div class="container">
                <div class="row">
                    <div class="col-lg-6 offset-lg-3">
                    <div class="section-heading wow bounceIn" data-wow-duration="1s" data-wow-delay="0.2s">
                        <h2>CV <span>Toolbar</span></h2>
                    </div>
                    </div>
                </div>
                </div>
            </div>
            <div className="row justify-content-center">
                    {data.componentData.map((item, index) => {
                        return(
                            <div class="card-body text-center">
                            <h5 class="card-title">{item.title}</h5>
                            <p class="card-text">{item.desc}</p>
                            <button className="btn btn-success" onClick={ () => addItem(props.item)}>Add to Pipeline</button>
                    </div>
                        )
                    })}

            </div>
        </div>
    );
}

export default Toolbar;
